(1, 1, 5000.00, 'Dizajn bašte', 'Ova usluga uključuje izradu detaljnog plana za raspored biljaka, staza, vodenih elemenata i drugih struktura u bašti. Dizajneri sarađuju sa klijentima kako bi kreirali estetski privlačan i funkcionalan prostor, prilagođen specifičnim željama i uslovima okoline.'),
(2, 1, 10000.00, 'Sadnja i održavanje biljaka', 'Ova usluga obuhvata izbor, sadnju i brigu o biljkama, grmlju i drveću u bašti. Uključuje redovno zalivanje, đubrenje, orezivanje i zaštitu od štetočina, kako bi bašta ostala zdrava i lepo uređena tokom cele godine.'),
(3, 1, 7000.00, 'Košenje i održavanje travnjaka', 'Redovno košenje, đubrenje i prozračivanje travnjaka kako bi se održao zdrav i uredan izgled. Takođe može uključivati i postavljanje novog travnjaka ili popravku oštećenih delova.'),
(4, 1, 7000.00, 'Uređenje i održavanje staza i patija', 'Postavljanje i održavanje popločanih staza, patija i terasa. To može uključivati čišćenje, uklanjanje mahovine, reparaciju ili čak zamenu oštećenih delova.'),
(5, 1, 17000.00, 'Ugradnja i održavanje sistema za navodnjavanje', 'Instalacija automatskih sistema za navodnjavanje, kao što su prskalice i kap po kap sistemi, kako bi se obezbedilo optimalno zalivanje biljaka. Održavanje ovih sistema takođe je ključni deo usluge.'),
(6, 1, 3000.00, 'Uklanjanje otpada iz bašte', 'Uklanjanje lišća, granja, orezanog bilja i drugog organskog otpada iz bašte, uključujući i sezonsko čišćenje bašte.'),
(7, 1, 12000.00, 'Postavljanje i održavanje rasvete u bašti', 'Instalacija rasvetnih sistema koji poboljšavaju estetski izgled bašte i omogućavaju korišćenje prostora u večernjim satima. Redovno održavanje i zamena sijalica ili drugih rasvetnih elemenata takođe spadaju u ovu uslugu.'),
(9, 2, 13000.00, 'Postavljanje i održavanje rasvete u bašti', 'Instalacija rasvetnih sistema koji poboljšavaju estetski izgled bašte i omogućavaju korišćenje prostora u večernjim satima. Redovno održavanje i zamena sijalica ili drugih rasvetnih elemenata takođe spadaju u ovu uslugu.'),
(10, 2, 10500.00, 'Sezonska dekoracija', 'Dodavanje sezonskih dekoracija kao što su praznični ukrasi ili teme koje se menjaju sa godišnjim dobima.'),
(11, 2, 4000.00, 'Dizajn bašte', 'Ova usluga uključuje izradu detaljnog plana za raspored biljaka, staza, vodenih elemenata i drugih struktura u bašti. Dizajneri sarađuju sa klijentima kako bi kreirali estetski privlačan i funkcionalan prostor, prilagođen specifičnim željama i uslovima okoline.'),
(12, 9, 3500.00, 'Letnja dekoracija', 'Letnja dekoracija'),
